const Card = ({ card }) => {
  console.log(card);
  const { name, description } = card;
  return (
    <div className="Container-Card">
      <h2>imagem </h2>
      <h3>titulo repo : {name}</h3>
      <h3>descricao : {description}></h3>
    </div>
  );
};

export default Card;
